# <h1>Shadows of the Knight, Python Code Solution</h1>


# <h2>Summary</h2>
# <p>The goal is to move Batman to the <em>location </em>of the bomb under a
#     certain number of <em>turns</em>, or else the bomb&nbsp;explodes and you
#     lose.</p>
# <p>The<em> location</em> of Batman and the bomb are depicted by x &amp; y
#     coordinates (Ex. Batman's location is (2, 5)).</p>
# <p>The only data you receive from the program is the<strong>
#     </strong><em>direction</em> of the bomb from Batman.</p>
# <p>The <em>direction</em> the user receives can be&nbsp;U (up), D (down), L
#     (left), R (right), or a combination of the vertical and horizontal
#     directions (Ex. UL = up, left).</p>
# <p>After each turn, Batman's new location is set and the direction of the bomb
#     from Batman's location is given.</p>
