# <h2>Reflection/Flow Chart</h2>
# <p><img src="data:image/jpeg;base64,"
#         width="376" height="287"></p>
# <p>Here are some things to note before getting into the solution:</p>
# <p>1) The value of the width and height of the building are given as variable
#     w and h respectively. However, changing these values will <strong>not
#     </strong>change the building size of the game being played.</p>
# <p>2) n is the variable for the maximum amount for turns before the game is
#     over. Changing this value will <strong>not</strong> change the amount of
#     turns that are available in the game being played.</p>
# <p>3) The only output the program will read from the user is a print statement
#     with two integers (Ex. "print(x0, y0)" where x0 and y0 hold integer
#     values). This determines the next space Batman will move to.</p>
# <p>&nbsp;</p>
# <p>My process in solving this problem begins with getting the direction of the
#     bomb. This value is provided as the variable bomb_dir. From there, I must
#     calculate where to have Batman jump next.</p>
# <p>We can solve the early puzzles by having Batman jump in the direction of
#     the bomb 1 space at a time, but there are not enough turns for the later
#     puzzles. So, we must use an equation that can have Batman
#     move&nbsp;farther and deduce the possible locations of the bomb. First, I
#     increase/decrease the min/max values of where the bomb can be depending on
#     the direction of the bomb.</p>
# <p>It is important to lower the range of where the bomb can be, so that each
#     jump can be more specific in the area of the bomb. Next, I applied this to
#     an equation to find where Batman should jump next:</p>
# <p><img
#         src="data:image/jpeg;base64,">
# </p>
# <p>This way batman not only jumps halfway across the building on the first
#     jump, but also the usage of the min and max values allows for a more
#     specified area for Batman to go towards. These equations are the binary
#     search algorithms.</p>
# <p><strong>Initializations at the Start of Each Game</strong></p>

import sys
import math



# <p>w: width of the building.</p>
# <p>h: height of the building.</p>
# <p>x0, y0: Batman's coordinates on the building.</p>
w, h = [int(i) for i in input().split()]
n = int(input())  # maximum number of turns before game over.
x0, y0 = [int(i) for i in input().split()]


# <p>Initialized min/max values of where the bomb could be. These values should
#     be updated as Batman&nbsp;</p>
# <p>moves and a new direction of the bomb is retrieved.</p>
min_x = 0
min_y = 0
max_x = w - 1 
max_y = h - 1

# <p><strong>&nbsp;Game Loop</strong></p>
while True:

    bomb_dir = input()  # the direction of the bombs from batman's current location (U, UR, R, DR, D, DL, L or UL)

    # <p>Depending on the direction given to the user, increase/decrease the
    #     min/max values of where the bomb can be.</p>
    # <p>If bomb is above batman, decrease the max_y so the next binary search
    #     result is pushed upwards of batman.</p>
    if bomb_dir.find("U") != -1:
        max_y = y0 - 1
# <p>&nbsp; &nbsp; &nbsp; &nbsp;If bomb is below batman, increase the min_y so
#     the next binary search result is pushed downwards of batman.</p>
    elif bomb_dir.find("D") != -1:
        min_y = y0 + 1
    
    # <p>&nbsp;If bomb is to the left of batman, decrease the max_y so the next
    #     binary search result is pushed to the left of batman.</p>
    if bomb_dir.find("L") != -1:
        max_x = x0 - 1
    # <p>&nbsp;If bomb is to the right of batman, increase the min_y so the next
    #     binary search result is pushed to the right of batman.</p>
    elif bomb_dir.find("R") != -1:
        min_x =x0 + 1

    # <p>These equations find the next coordinates Batman should jump to.</p>
    x0 = min_x + ((max_x  - min_x) // 2)
    y0 = min_y + ((max_y  - min_y) // 2)

    # <p>&nbsp;The location of the next window Batman should jump to.</p>
    print(x0, y0)
